import React from 'react';

function ExpenseDetails({ incomeAmt, expenseAmt }) {
    return (
        <div className="bg-gray-300 p-4 rounded-lg mb-4">
            <h2 className="text-xl font-bold">Your Balance Amount <span className='text-blue-700'>₹{incomeAmt - expenseAmt}</span></h2>
            <div className="flex justify-between text-lg font-bold">
                <div className="text-black">
                    Income <span className="ml-2 text-green-600">₹{incomeAmt}</span>
                </div>
                <div className="text-black">
                    Expense <span className="ml-2 text-red-600">₹{expenseAmt}</span>
                </div>
            </div>
        </div>
    );
}

export default ExpenseDetails;
